text:
spare me the fucking rhetoric of “they’re illegals”, “we must uphold our laws”, “they shouldn’t have brought their children with them.” these are asylum refugees fleeing persecution and violence from their home countries. they are doing it the legal way by turning themselves in at the border to start the process of being granted asylum. tear gassing women and children is nothing but a racist dog-whistle-megaphone that the white house administration has thought up in order to throw a bone to his rabid, bigoted, racist, xenophobic base. the republicans fucking own inherent racism and silently sit by while it happens all because they want one last grasp at power until the us becomes a minority majority country. they have thrown out all sense of morality or empathy because they are terrified of a future where they aren’t the majority. thoughts and prayers to complicit republicans. from our backup site @striveforpositivechange 🤬✊❤️
